import React from "react";
import "../styles/global.css";

const Education = () => {
  return (
    <div className="education">
      <h1>Education</h1>
      <div className="timeline">
        <div className="timeline-item">
          <span className="date">2022 - Present</span>
          <h3>Rajagiri School of Engineering & Technology</h3>
          <p>B.Tech in Computer Science and Engineering</p>
        </div>
        <div className="timeline-item">
          <span className="date">2020 - 2022</span>
          <h3>St. Josephâ€™s School, Kuriachira</h3>
          <p>Higher Secondary Education</p>
        </div>
        <div className="timeline-item">
          <span className="date">2008 - 2020</span>
          <h3>Don Bosco ICSE School, Mannuthy</h3>
          <p>Primary & Secondary Education</p>
        </div>
      </div>
    </div>
  );
};

export default Education;
